package srujan;

public class Typecasting {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
		double d= 20.000;
		long i=(long)d;
		int l=(int)d;
		System.out.println("double d="+d);
		System.out.println("long l="+i);
		System.out.println("int i="+l);

	}
}
